"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F10149866\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Bridion (AU, IS, NZ, NO)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list_set htclist drugH1Div drugBrandNames\" id=\"F10149867\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Antidote",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block iuse drugH1Div\" id=\"F10149868\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reported Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Reversal of neuromuscular blockade induced by rocuronium or vecuronium",
"    </p>",
"   </div>",
"   <div class=\"block idos drugH1Div\" id=\"F10150204\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     I.V.:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Children &ge;2 to &le;17 years: Routine reversal of rocuronium-induced neuromuscular blockade: 2 mg/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Adults &ge;18 years:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Reversal of rocuronium- or vecuronium-induced deep neuromuscular blockade: 4 mg/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Reversal of rocuronium- or vecuronium-induced moderate neuromuscular blockade: 2 mg/kg; may repeat with 4 mg/kg if reoccurrence of blockade occurs",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Immediate reversal of rocuronium-induced neuromuscular blockade: 16 mg/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      Note:",
"     </b>",
"     Wait 24 hours before readministering rocuronium or vecuronium",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;margin-top:2em;\">",
"     <b>",
"      Dosage adjustment in renal impairment:",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Cl",
"     <sub>",
"      cr",
"     </sub>",
"     &ge;30 to &lt;80 mL/minute: No adjustment required",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Cl",
"     <sub>",
"      cr",
"     </sub>",
"     &lt;30 mL/minute: Use not recommended for dialysis patients",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      Dosage adjustment in hepatic impairment:",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Mild-to-moderate impairment: No adjustment required",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Severe impairment: Has not been evaluated",
"    </p>",
"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F11821247\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Product available in various countries; not currently available in the U.S.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F10149871\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Injection, solution: 100 mg/mL (2 mL, 5 mL)",
"    </p>",
"   </div>",
"  </div>",
