"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Treatment for 7 to 10 days.",
"     <br>",
"      &bull; Treatment for 7 to 10 days, but duration may vary.&nbsp;High doses of azithromycin (600 to 1000 mg) combined with atovaquone (750 mg) may be used for the treatment of immunocompromised patients. Partial or complete exchange transfusion is recommended in case of high parasitemia (&gt;10 percent), severe anemia (hemoglobin &lt;10 g/dL), pulmonary, renal or hepatic failure. In asplenic individuals and in immunocompromised patients, therapy should be &gt;6 weeks, including 2 weeks after parasites are no longer detected on blood smear.",
"      <br>",
"       &Delta; Treatment for 7 to 10 days, but duration may vary.",
"      </br>",
"     </br>",
"    </div>",
